// ================================================
// Fast Search Card for Home Assistant
// ================================================

(function() {
  'use strict';
  
  console.log('[Fast-Search-Card] Loading...');
  
  // Global polyfills
  if (typeof window !== 'undefined') {
    window.process = window.process || { 
      env: { NODE_ENV: 'production' },
      platform: 'browser',
      version: ''
    };
    window.global = window.global || window;
    window.Buffer = window.Buffer || { isBuffer: () => false };
  }
  
  // Custom Element Class
  class FastSearchCardElement extends HTMLElement {
    constructor() {
      super();
      console.log('[Fast-Search-Card] Constructor');
      this.attachShadow({ mode: 'open' });
      this._config = {};
      this._hass = null;
      this._initialized = false;
      this._appMounted = false;
    }
    
    setConfig(config) {
      console.log('[Fast-Search-Card] setConfig:', config);
      if (!config) {
        throw new Error('Invalid configuration');
      }
      
      this._config = config;
      
      if (this._initialized && !this._appMounted) {
        this._render();
      }
    }
    
    set hass(hass) {
      const count = hass ? Object.keys(hass.states || {}).length : 0;
      console.log('[Fast-Search-Card] hass updated, entities:', count);
      
      this._hass = hass;
      
      if (this._appMounted && window.FastSearchCardApp && window.FastSearchCardApp.updateHass) {
        const root = this.shadowRoot?.querySelector('#app-root');
        if (root) {
          window.FastSearchCardApp.updateHass(root, this._hass);
        }
      } else if (this._initialized && !this._appMounted) {
        this._tryMountApp();
      }
    }
    
    connectedCallback() {
      console.log('[Fast-Search-Card] Connected to DOM');
      this._initialized = true;
      
      if (!this._appMounted) {
        this._render();
      }
    }
    
    disconnectedCallback() {
      console.log('[Fast-Search-Card] Disconnected from DOM');
      this._initialized = false;
      
      if (this._appMounted && window.FastSearchCardApp && window.FastSearchCardApp.unmount) {
        const root = this.shadowRoot?.querySelector('#app-root');
        if (root) {
          window.FastSearchCardApp.unmount(root);
        }
      }
    }
    
    _render() {
      if (!this.shadowRoot || !this._initialized || this._appMounted) {
        return;
      }
      
      console.log('[Fast-Search-Card] Rendering...');
      
      this.shadowRoot.innerHTML = `
        <style>
          :host {
            display: block;
            position: relative;
            height: 100%;
            min-height: 400px;
          }
          
          #app-root {
            width: 100%;
            height: 100%;
            position: relative;
          }
          
          .loading {
            padding: 40px;
            text-align: center;
            background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
            border-radius: 12px;
            height: 100%;
            display: flex;
            align-items: center;
            justify-content: center;
            color: white;
            font-size: 18px;
          }
        </style>
        <div id="app-root">
          <div class="loading">Loading Fast Search Card...</div>
        </div>
      `;
      
      // Try mounting immediately and periodically
      this._tryMountApp();
    }
    
    _tryMountApp() {
      if (this._appMounted) {
        return;
      }
      
      const root = this.shadowRoot?.querySelector('#app-root');
      if (!root) {
        console.error('[Fast-Search-Card] No root element found');
        return;
      }
      
      // Check if app is ready
      if (window.FastSearchCardApp && typeof window.FastSearchCardApp.mount === 'function') {
        console.log('[Fast-Search-Card] Mounting app...');
        
        try {
          const result = window.FastSearchCardApp.mount(root, this._hass, this._config);
          if (result !== false) {
            this._appMounted = true;
            console.log('[Fast-Search-Card] ✅ App mounted successfully!');
          }
        } catch (error) {
          console.error('[Fast-Search-Card] Mount error:', error);
          root.innerHTML = `
            <div style="padding: 20px; color: red;">
              Error mounting app: ${error.message}
            </div>
          `;
        }
      } else {
        // Retry
        console.log('[Fast-Search-Card] App not ready, retrying...');
        setTimeout(() => {
          if (!this._appMounted) {
            this._tryMountApp();
          }
        }, 100);
      }
    }
    
    getCardSize() {
      return this._config?.card_height || 10;
    }
    
    static getStubConfig() {
      return {
        type: 'custom:fast-search-card',
        title: 'Device Search'
      };
    }
  }
  
  // Register element
  if (!customElements.get('fast-search-card')) {
    customElements.define('fast-search-card', FastSearchCardElement);
    console.log('[Fast-Search-Card] ✅ Custom element registered!');
    
    window.customCards = window.customCards || [];
    window.customCards.push({
      type: 'fast-search-card',
      name: 'Fast Search Card',
      description: 'Fast device search card'
    });
  }
  
})();

